import React from "react";
import Heading from './Heading';
import Entry from './Entry';
import emojipedia from '../emojipedia';

function createEmojiCard(emoji){

  return <Entry 
             img = {emoji.emoji}
         ></Entry>
}

function App() {
  return (
    <div>

      <Heading></Heading>

      <dl className="dictionary">

      {emojipedia.map(createEmojiCard)}






      </dl>
    </div>
  );
}

export default App;
